function write_file() {
    var apk_b64 = "";
    var dir_path = runtime.appInfo.dataDir.value + "/files/plugins-download/download/";
    // console.log(runtime.appInfo.dataDir.value);
    var path = dir_path + "plugin-center.apk";
    var apk = decodeBase64(apk_b64);
    // file.writeBytes(path, apk);
    var fd = new File(path, 'wb');
    fd.write(apk);
    fd.flush();
    fd.close();
};
